import Todo from './Todo'
function ListTodo(props){
    const removeTodo = (toDelete) =>{
        return props.todoList.filter((todo) => {return todo.title !== toDelete.title})
    }
    return (
        <div>
        {
            props.todoList.map((todo) => 
                <li>
                    {
                        Object.keys(todo).map(
                            (key) => //<ul>{todo[key]}</ul>
                                <Todo todo = {todo} field = {key} todoList = {props.todoList} updateList = {props.updateList}/>
                        )
                    }
                    <button onClick = 
                        {
                            (e)=>
                            {
                                e.preventDefault();
                                props.updateList(removeTodo(todo))
                                //console.log(props.todoList)
                            }
                        }>Delete
                    </button>
                </li>
            )
        }
        </div>
    )
}

export default ListTodo
